import React from 'react'
import './App.css';
import UserList from './components/Users';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      'users' : []
    }
  }
  componentDidMount() {
    const users = [
      {
        'id' : 1,
        'first_name': 'Фёдор',
        'last_name': 'Достоевский',
        'birthday_year': 1821
        },
        {
        'id': 2,
        'first_name': 'Александр',
        'last_name': 'Грин',
        'birthday_year': 1880
        },
    ]
    this.setState( {
      'users' : users
    })  
  }

  render() {
    return (
      <div>
        <UserList users={this.state.authors}/>
      </div>
    )
  }

}
export default App;
